window.bookSummaryJSON = "<p><b>As parts of everyday life begin to fade away, one teacher struggles to keep a semblance of normality for the teenagers in her classroom. </b></p> <p>But what can she teach to students who know they will one day be the final remnants of mankind?&nbsp;</p> <p>\"The Last Teacher\" is a story from The Great De-Evolution series about the lessons that are most important in life.</p>"; 
